```python
def gcd(a, b):
    while b != 0:
        a, b = b, a % b
    return a

def lcm(a, b):
    return a * b // gcd(a, b)

b = int(input())
count = 0
for i in range(1, b + 1):
    if lcm(i, b) == b:
        count += 1
print(count)
